import React from 'react';

class LateralMenu extends React.Component{
	getStyle = () => {
		return {
			float: 'left',
			background: '#4682B4',
			padding: '20px',
			width: '25%',
			height: '100vh',

			// changing fonts...
			color: '#F0F8FF',
			fontFamily: "verdana",
			fontWeight: 'bold',
			fontSize: '12'
		}
	}

	render(){
		return(
			<div style={this.getStyle()}>
				<p>COMPANIES</p>
				<p>USUÁRIOS</p>
				<p>RESETAR SENHA</p>
				<p>SIMULAÇÃO</p>
			</div>
		);
	}
}

export default LateralMenu;
